import './App.css';

function App() {
  return (
    <div className="App">
      <h2>Login</h2>
      <br/><br/>
      <div className="form">
          <label>UserName</label>
          <input type="text" name="user"/>
          <label>Password</label>
          <input type="text" name="password"/>
          <button>Submit</button>
      </div>
    </div>
  );
}

export default App;
